/* React */
import React from 'react';

/* Material-UI */
import { Box } from '@material-ui/core';

import HomeIcon from '@mui/icons-material/Home';

const Navigation = ({
    
}) => {

  return(
    <Box
    >
      <Box
          component='img'
          width='100%'
          src={HomeIcon}
          class='side-bar-icons'
      />
    </Box>
    )
}

export default Navigation;
